#include <iostream>
#include <queue>
#include <cmath>
#include <vector>
using namespace std;

void rec(int x) {
    if(x == 0) {
        return;
    }
    int cifra = x % 10;
    rec(x / 10);
    cout << cifra << " ";
 
}
int main()
{
    
    rec(1234);
  
    return 0;
}

