#include <iostream>
#include <queue>
#include <cmath>
#include <vector>
using namespace std;

void rec(int x) {
    if(x > 5) {
        return;
    }
    rec(x + 1);
    cout << x << endl;
}
int main()
{
    
    rec(1);
  
    return 0;
}
// rec(1) --> rec(2) | cout << 1 << endl;
// rec(2) --> rec(3) | cout << 2 << endl;
// rec(3) --> rec(4) | cout << 3 << endl;
// rec(4) --> rec(5) | cout << 4 << endl;
// rec(5) --> rec(6) | cout << 5 << endl;
// rec(6)

#include <iostream>
#include <queue>
#include <cmath>
#include <vector>
using namespace std;

void rec(int x) {
    if(x < 1) {
        return;
    }
    cout << x << endl;
    rec(x - 1);
}
int main()
{
    
    rec(5);
  
    return 0;
}

